const mkArray = (from: number, to: number): number[] =>
  to >= from ? [...new Array(to - from + 1)].map((_, i) => i + from) : [];

// Clear recursive
// const zipWith = <A, B, C>(f: (x: A, Y: B) => C) => (xs: A[], ys: B[]): C[] =>
//   xs.length === 0 || ys.length === 0
//     ? []
//     : [f(xs[0], ys[0])].concat(zipWith(f)(xs.slice(1), ys.slice(1)));

// Recursive with tail recursion
// const zipWithDoer = <A, B, C>(f: (x: A, Y: B) => C) => (
//   prev: C[],
//   xs: A[],
//   ys: B[],
// ): C[] =>
//   xs.length === 0 || ys.length === 0
//     ? prev
//     : zipWithDoer(f)(prev.concat(f(xs[0], ys[0])), xs.slice(1), ys.slice(1));
//
// const zipWith = <A, B, C>(f: (x: A, Y: B) => C) => (xs: A[], ys: B[]): C[] =>
//   zipWithDoer(f)([], xs, ys);

const zipWith = <A, B, C>(f: (x: A, Y: B) => C) => (xs: A[], ys: B[]): C[] =>
  xs.length >= ys.length
    ? ys.reduce((rs: C[], y: B, i: number): C[] => rs.concat([f(xs[i], y)]), [])
    : xs.reduce(
        (rs: C[], x: A, i: number): C[] => rs.concat([f(x, ys[i])]),
        [],
      );

const and = (bs: boolean[]) => bs.reduce((r, b) => r && b, true);

const compareArrays = <T>(xs: T[], ys: T[]) =>
  xs.length === ys.length ? and(zipWith((x, y) => x === y)(xs, ys)) : false;

// Clear recursive
// const nChunksOf = (n: number, k: number) => (s: string): string[] =>
//   n <= 0 || s === ''
//     ? []
//     : [s.slice(0, k)].concat(nChunksOf(n - 1, k)(s.slice(k)));

// Recursive with tail recursion
// const nChunksOfDoer = (n: number, k: number) => (
//   prev: string[],
//   s: string,
// ): string[] =>
//   n <= 0 || s.length === 0
//     ? prev
//     : nChunksOfDoer(n - 1, k)(prev.concat([s.slice(0, k)]), s.slice(k));
//
// const nChunksOf = (n: number, k: number) => (s: string): string[] =>
//   nChunksOfDoer(n, k)([], s);

const nChunksOf = (n: number, k: number) => (s: string): string[] =>
  mkArray(0, n - 1).reduce((rs: string[], i: number): string[] => {
    const pos = i * k;
    const chunk = s.slice(pos, pos + k);
    return chunk.length === 0 ? rs : rs.concat([chunk]);
  }, []);

const nSortedChunksOf = (n: number, k: number) => (s: string): string[] =>
  nChunksOf(n, k)(s).sort();

const findSubstring = (s: string, words: string[]): number[] => {
  if (words.length === 0) {
    return [];
  }
  const l = words.length;
  const wl = words[0].length;
  const sortedWords = words.slice().sort();
  return mkArray(0, s.length - l * wl).reduce(
    (ixs, i) =>
      compareArrays(nSortedChunksOf(l, wl)(s.slice(i)), sortedWords)
        ? ixs.concat(i)
        : ixs,
    [],
  );
};

